css:
.nuclide-service-monitor-root {
  display: flex;
  flex-direction: column;
  height: 100%;
}
.nuclide-service-monitor-header {
  display: flex;
}
.nuclide-service-monitor-left-header {
  align-self: center;
  flex: 1;
}
.nuclide-service-monitor-right-header {
  flex: 1;
  text-align: right;
}
.nuclide-service-monitor-filter-container {
  display: inline-block;
  min-width: 200px;
  position: relative;
  text-align: left;
  width: 200px;
}
.nuclide-service-monitor-contents {
  flex: 1;
  height: 100%;
  overflow-y: scroll;
}
.nuclide-service-monitor-header-cell {
  padding: 5px 10px;
}
.nuclide-service-monitor-cell {
  font-family: Menlo, Monaco, Consolas, monospace;
  padding: 5px 10px;
  white-space: nowrap;
}
